/**
 * @ignore
 */
var NativeObjectBehavior = {
    /**
     * @ignore
     * @memberof NativeObjectBehavior
     */
    _methods: {
        /**
         * Returns the native application object that is represented by this test object instance,
         * enabling you to access the native properties and methods provided by that object.
         * @function
         * @returns {Promise<Object>} a promise that is fulfilled with the native application object that is represented by this test object instance.
         */
        nativeObject: function () {
            return this._executeWithEvents(arguments, "Object");
        }
    }
};

module.exports = NativeObjectBehavior;